import React, { Suspense } from "react";
import { Link, Route, Switch, useParams, useRouteMatch } from "react-router-dom";
import Image from "../../../../components/Image";
import ProfileLeft from "../../../../components/ProfileLeft";
import profilePic from '../../../../assets/Images/pexels-photo-220453.jpeg';
const BasicDetails = React.lazy(() => import("./BasicDetails"));
const RecentViews = React.lazy(() => import("./RecentViews"));



export default function MyProfile() {
let { path, url } = useRouteMatch();
let { topicId } = useParams();
  return (
    <section className="myProfile">
      <div className="row">
        {/* <ProfileLeft class="col-3 profileLeft" /> */}
        <div className="col-3 profileLeft">
          <Image
            src={profilePic}
            alt="profile picture"
            height="300px"
            width="250px"
          />
          <div className="mt-3">
            <p className="mt-3 button raise">
              <Link to={`${url}/BasicDetails`}>Basic details</Link>
            </p>
            <p className="mt-3 button raise">
              <Link to={`${url}/Views`}>Recently viewed</Link>
            </p>
            <p className="mt-3 button raise">
              <Link to="/">My blog posts</Link>
            </p>
            <p className="mt-3 button fill">
              <Link to="/">Favourite items</Link>
            </p>
            <p className="mt-3 button pulse">
              <Link to="/">Bookmarked posts</Link>
            </p>
            <p className="mt-3 button offset">
              <Link to="/">Settings</Link>
            </p>
          </div>
        </div>
        <div className="col-9 profileright">
          <Suspense fallback={"Loading"}>
            <Switch>
              <Route path={`${path}/:topicId`} component={topicId} />

              {/* <Route path="/SignUp" exact component={RecentViews} /> */}
              {/* <Route path="/SignUp" exact component={SignUp} />
              <Route path="/ResetPassword" exact component={ResetPassword} />
              <Route path="/ResetPassword" exact component={ResetPassword} />
              <Route path="/ResetPassword" exact component={ResetPassword} /> */}
            </Switch>
          </Suspense>
        </div>
      </div>
    </section>
  );
}
